    const[user,setuser]=useState([]);

    function logconf()
    {
        axios.get('http://127.0.0.1:8000/logout/')
        setLogedIn('')
        redirect('/login')

    }
  return (
<>
<center>
    <h4>ARE YOU WANT LOGOUT?...</h4>
    <button onClick={()=>logconf()} className='btn btn-warngin'>YES</button>
    <NavLink to='/show'><button className='btn btn-success'>NO</button></NavLink>
</center>
</>  
)
}
